	n = int(input())
	aa = list(map(int, input().split()))
	m = {}
	for i, a in enumerate(aa):
		if a not in m:
			m[a] = set()
		m[a].add(i)
	result = []
	for i, a in enumerate(aa):
		result.append(m.get(a, set()))
		if len(result) > 1:
			m[a].difference_update(result[-1])
	if len(m) > 0:
		return -1
	result.sort()
	indices = {aa[i] : i for i in range(len(aa))}
	for i, a in enumerate(aa):
		for j in range(i):
			b = a + a
			if b not in indices:
				indices[b] = indices[a]
				result[indices[b]].add(j)
	result = [b for a, b in result]
	if len(result) == 1:
		print(len(m))
	else:
		print(-1)


